import React from "react";

const Activities = () => {
  return (
    <container>
      <div className="activity-title">
        <h1>Extra Curricular Activites</h1>
      </div>
      <div className="activity">
        <div className="image">img </div>
        <div className="activity-content">
          <h3></h3>
        </div>
      </div>
    </container>
  );
};

export default Activities;
